import Banner from "../components/Banner";

export default function Food() {
  return (
    <div>
      <Banner
        title="四國美食"
        subtitle="舌尖上的日本小島風情"
        imageUrl="https://images.unsplash.com/photo-1604908177522-4029f27fad88"
      />
      <div className="mt-6 space-y-4 text-gray-700">
        <p>從高松的烏龍麵，到德島的魚料理，再到愛媛的柑橘甜點，每一口都值得細細品味。</p><p>一起探索四國在地的風味美食，享受美好時光！</p>
      </div>
    </div>
  );
}
